import QuoteList from "../components/quotes/QuoteList";

const DUMMY_QUOTES = [
  {
    id: "q1",
    author: "Korbi",
    text: "To React or not to React",
  },
  {
    id: "q2",
    author: "Leo",
    text: "Life is like a React component",
  },
];

const AllQuotes = () => {
  return (
    <>
      <QuoteList quotes={DUMMY_QUOTES} />
    </>
  );
};

export default AllQuotes;
